Swift で作ってみた。 `^` は別の演算子なので Python 等に倣って `**` で代用。
```swift
precedencegroup UpArrowPrecedence {
    higherThan: MultiplicationPrecedence
    associativity: right
}
infix operator **
infix operator ^^
infix operator ^^^

func **(lhs: Int, rhs: Int) -> Int {
    return uparrow(lhs, rhs, *)
}

func ^^(lhs: Int, rhs: Int) -> Int {
    return uparrow(lhs, rhs, **)
}

func ^^^(lhs: Int, rhs: Int) -> Int {
    return uparrow(lhs, rhs, ^^)
}

private func uparrow(_ lhs: Int, _ rhs: Int, _ operation: (Int, Int) -> Int) -> Int {
    precondition(rhs >= 0)    
    var result = 1
    for _ in 0..<rhs {
        result = operation(lhs, result)
    }
    return result
}

print(2 ** 3)  // 8
print(2 ^^ 3)  // 16
print(2 ^^^ 3) // 65536
