たとえば、↓の関数はすべて等しいことになるんじゃないかと。
```swift
func foo(_ x: UInt) -> UInt {
  return x * x
}

func square(of number: UInt) -> UInt {
  let result = number * number
  return result
}

func bar(_ x: UInt) -> UInt {
  guard x > 0 else { return 1 }
  var result = 0
  for v in 0..<x {
    result += x
  }
  return x
}
```

実装そのものではなく、↑の `foo(_)` と `square(of:)` と `bar(_)` を同一とみなす、ただし↓は同一とみなさないという場合です。
